import React from "react";
import Header from "./Header";
// import Parallax from "./Parallax";
import Button from "@material-ui/core/Button";
import AppBar from "@material-ui/core/AppBar";
import MainCard from "./MainCard";
import Toolbar from "@material-ui/core/Toolbar";
import GridPost from "./GridPost";
import GridList from "@material-ui/core/GridList";
import Grid from "@material-ui/core/Grid";

const mainCardContent = {
  title: "Simple and fun way to start your cooking journey",
  description: "Love to cook but always struggle to come up with ideas?",
  description2:
    "SmartCook is a web app designed for all food lovers who enjoy cooking,exploring new recipes, creating recipe journals, and socializing about food/cooking",
  //image: 'https://source.unsplash.com/random',
  //imgText: 'main image description',
  //linkText: 'Continue reading…',
};

export default function LandingPage(props) {
  const nums = Array.from(Array(4).keys());

  return (
    <div>
      <div className="landing-page-container">{/* <Header /> */}</div>
      <Header />
      <MainCard card={mainCardContent} />
      <GridList cols={4}>
        {nums.map((n) => {
          return <GridPost key={n} num={n}></GridPost>;
        })}
      </GridList>
    </div>
  );
}
